    false,nt"url": null,nt"notes": "NCEI Accession 0130824 includes physical
    and profile data collected aboard the FAIRWEATHER during project OPR-O322-FA-10
    in the Coastal Waters of SE Alaska from 2010-09-23 to 2010-11-09. These data include
    CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and
    WATER TEMPERATURE. The instruments used to collect these data include CTD and sound
    velocimeter - moving vessel profiler. These data were collected and submitted by
    the NOAA Office of Coast Survey in support of hydrographic multibeam surveys to
